INSERT INTO `exercise` VALUES (10,'class','練習用','本ツールの操作に慣れるための練習です。\nクラスの作成、関連の作成、要素の編集など、いろいろ試してみてください。','2015-10-26 01:36:32',0),(11,'misusecase','Testtestq','aaaa','2015-10-27 16:34:23',0),(13,'class','プロジェクト人員管理システム','会社の人員管理システムを作りたい。会社には複数の部署（部署名、部長ID）が存在し、全ての社員（社員ID、社員名）はそれぞれ1つの部署に所属している。\n会社では、プロジェクト（プロジェクト名）が発生することがある。プロジェクトは、主担当となる一つの部署が管理を行う。プロジェクトは単独または複数の社員が共同で担当する。\nプロジェクトを担当する社員は、主担当部署以外の部署に所属していることもある。複数のプロジェクトが並列で行われる場合があり、このような場合には、社員は複数のプロジェクトを掛け持ちで担当できる。社員は、各プロジェクトに対し、開発者、マネージャ、テスター、予備人員などの役割をひとつ持つ。\nプロジェクトでは、複数の成果物（成果物名）が作成される。本システムでは、これらの成果物がどのプロジェクトで作成されたものか管理できる必要がある。各成果物には責任者がひとり存在し、その成果物の編集や改版の管理などを担当する。\n\n注）モデル化するうえで、適切な語句が課題文中にある場合は、その語句を使ってモデルを作ってください。また、必要だと感じたら課題文中にない語句を加えてもかまいません。\n','2015-11-12 01:14:24',0);
/*!40000 ALTER TABLE `exercise` ENABLE KEYS */;
UNLOCK TABLES;

